ss Translation Day 4 in Nha Trang\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:77:\"https://vi.wordpress.org/2019/05/13/wordpress-translation-day-4-in-nha-trang/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:85:\"https://vi.wordpress.org/2019/05/13/wordpress-translation-day-4-in-nha-trang/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 13 May 2019 01:50:11 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:6:\"Meetup\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:9:\"Nha Trang\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://vi.wordpress.org/?p=816\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:349:\"Sáng ngày 11/05/2019, tại co-working space Văn Phòng Chia Sẻ – De Train Nha Trang đã diễn ra chương trình WordPress Translation Day 4 in Nha Trang (Ngày Hội Dịch Thuật WordPress Toàn Cầu Lần 4 tại Nha Trang) do Nha Trang WordPress tổ chức.  Chương trình đã nêu lên tầm quan trọng của việc [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:12:\"Thien Nguyen\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:6902:\"\n<ul class=\"wp-block-gallery columns-1 is-cropped\"><li class=\"blocks-gallery-item\"><figure><img src=\"https://vi.wordpress.org/files/2019/05/6-1024x576.jpg\" alt=\"\" data-id=\"824\" data-link=\"https://vi.wordpress.org/2019/05/13/wordpress-translation-day-4-in-nha-trang/attachment/6/\" class=\"wp-image-824\" srcset=\"https://vi.wordpress.org/files/2019/05/6-1024x576.jpg 1024w, https://vi.wordpress.org/files/2019/05/6-300x169.jpg 300w, https://vi.wordpress.org/files/2019/05/6-768x432.jpg 768w, https://vi.wordpress.org/files/2019/05/6.jpg 1600w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></figure></li></ul>\n\n\n\n<p>Sáng ngày 11/05/2019, tại co-working space Văn Phòng Chia Sẻ – De Train Nha Trang đã diễn ra chương trình WordPress Translation Day 4 in Nha Trang (Ngày Hội Dịch Thuật WordPress Toàn Cầu Lần 4 tại Nha Trang) do Nha Trang WordPress tổ chức. </p>\n\n\n\n<span id=\"more-816\"></span>\n\n\n\n<p>Chương trình đã nêu lên tầm quan trọng của việc phát triển đội ngũ tình nguyện viên dịch thuật Lõi WordPress, Giao Diện và Plugins ra hơn 186 ngôn ngữ bản địa trên toàn cầu là một trong những yếu tố quan trọng dẫn đến sự phát triển và phổ biến của WordPress trong hơn 15 năm qua. </p>\n\n\n\n<p>Ngoài việc hướng dẫn mọi người tham gia đóng góp bản dịch Tiếng Việt trên WordPress.Org, các quy định khi tham gia dịch thuật WordPress, Ban tổ chức còn trình bày nhiều thủ thuật, tiện ích hỗ trợ cho việc dịch thuật trở nên dễ dàng và thuận tiện hơn. </p>\n\n\n\n<p>Ban tổ chức xin trân trọng cám ơn co-working space Văn Phòng Chia Sẻ – De Train Nha Trang đã hỗ trợ rất nhiều cho buổi meetup, cám ơn metabox.io đã tài trợ các phần quà hấp dẫn cho các thành viên đến tham dự meetup. </p>\n\n\n\n<p>Xin cám ơn và hẹn gặp lại tại chương trình meetup Tháng 6/2019 của Nha Trang WordPress.</p>\n\n\n\n<ul class=\"wp-block-gallery columns-3 is-cropped\"><li class=\"blocks-gallery-item\"><figure><a href=\"https://vi.wordpress.org/files/2019/05/1-1024x768-1024x768.jpg\"><img src=\"https://vi.wordpress.org/files/2019/05/1-1024x768-1024x768.jpg\" alt=\"\" data-id=\"819\" data-link=\"https://vi.wordpress.org/?attachment_id=819\" class=\"wp-image-819\" srcset=\"https://vi.wordpress.org/files/2019/05/1-1024x768.jpg 1024w, https://vi.wordpress.org/files/2019/05/1-1024x768-300x225.jpg 300w, https://vi.wordpress.org/files/2019/05/1-1024x768-768x576.jpg 768w, https://vi.wordpress.org/files/2019/05/1-1024x768-440x330.jpg 440w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a></figure></li><li class=\"blocks-gallery-item\"><figure><a href=\"https://vi.wordpress.org/files/2019/05/2-1024x768-1024x768.jpg\"><img src=\"https://vi.wordpress.org/files/2019/05/2-1024x768-1024x768.jpg\" alt=\"\" data-id=\"820\" data-link=\"https://vi.wordpress.org/?attachment_id=820\" class=\"wp-image-820\" srcset=\"https://vi.wordpress.org/files/2019/05/2-1024x768.jpg 1024w, https://vi.wordpress.org/files/2019/05/2-1024x768-300x225.jpg 300w, https://vi.wordpress.org/files/2019/05/2-1024x768-768x576.jpg 768w, https://vi.wordpress.org/files/2019/05/2-1024x768-440x330.jpg 440w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a></figure></li><li class=\"blocks-gallery-item\"><figure><a href=\"https://vi.wordpress.org/files/2019/05/3-768x1024-768x1024.jpg\"><img src=\"https://vi.wordpress.org/files/2019/05/3-768x1024-768x1024.jpg\" alt=\"\" data-id=\"821\" data-link=\"https://vi.wordpress.org/?attachment_id=821\" class=\"wp-image-821\" srcset=\"https://vi.wordpress.org/files/2019/05/3-768x1024.jpg 768w, https://vi.wordpress.org/files/2019/05/3-768x1024-225x300.jpg 225w\" sizes=\"(max-width: 768px) 100vw, 768px\" /></a></figure></li><li class=\"blocks-gallery-item\"><figure><a href=\"https://vi.wordpress.org/files/2019/05/4-1024x768-1024x768.jpg\"><img src=\"https://vi.wordpress.org/files/2019/05/4-1024x768-1024x768.jpg\" alt=\"\" data-id=\"822\" data-link=\"https://vi.wordpress.org/?attachment_id=822\" class=\"wp-image-822\" srcset=\"https://vi.wordpress.org/files/2019/05/4-1024x768.jpg 1024w, https://vi.wordpress.org/files/2019/05/4-1024x768-300x225.jpg 300w, https://vi.wordpress.org/files/2019/05/4-1024x768-768x576.jpg 768w, https://vi.wordpress.org/files/2019/05/4-1024x768-440x330.jpg 440w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a></figure></li><li class=\"blocks-gallery-item\"><figure><a href=\"https://vi.wordpress.org/files/2019/05/5-1024x768-1024x768.jpg\"><img src=\"https://vi.wordpress.org/files/2019/05/5-1024x768-1024x768.jpg\" alt=\"\" data-id=\"823\" data-link=\"https://vi.wordpress.org/?attachment_id=823\" class=\"wp-image-823\" srcset=\"https://vi.wordpress.org/files/2019/05/5-1024x768.jpg 1024w, https://vi.wordpress.org/files/2019/05/5-1024x768-300x225.jpg 300w, https://vi.wordpress.org/files/2019/05/5-1024x768-768x576.jpg 768w, https://vi.wordpress.org/files/2019/05/5-1024x768-440x330.jpg 440w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a></figure></li><li class=\"blocks-gallery-item\"><figure><a href=\"https://vi.wordpress.org/files/2019/05/6-1024x576.jpg\"><img src=\"https://vi.wordpress.org/files/2019/05/6-1024x576.jpg\" alt=\"\" data-id=\"824\" data-link=\"https://vi.wordpress.org/?attachment_id=824\" class=\"wp-image-824\" srcset=\"https://vi.wordpress.org/files/2019/05/6-1024x576.jpg 1024w, https://vi.wordpress.org/files/2019/05/6-300x169.jpg 300w, https://vi.wordpress.org/files/2019/05/6-768x432.jpg 768w, https://vi.wordpress.org/files/2019/05/6.jpg 1600w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a></figure></li><li class=\"blocks-gallery-item\"><figure><a href=\"https://vi.wordpress.org/files/2019/05/7-1024x576.jpg\"><img src=\"https://vi.wordpress.org/files/2019/05/7-1024x576.jpg\" alt=\"\" data-id=\"825\" data-link=\"https://vi.wordpress.org/?attachment_id=825\" class=\"wp-image-825\" srcset=\"https://vi.wordpress.org/files/2019/05/7-1024x576.jpg 1024w, https://vi.wordpress.org/files/2019/05/7-300x169.jpg 300w, https://vi.wordpress.org/files/2019/05/7-768x432.jpg 768w, https://vi.wordpress.org/files/2019/05/7.jpg 1600w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a></figure></li><li class=\"blocks-gallery-item\"><figure><a href=\"https://vi.wordpress.org/files/2019/05/9-1024x576.jpg\"><img src=\"https://vi.wordpress.org/files/2019/05/9-1024x576.jpg\" alt=\"\" data-id=\"826\" data-link=\"https://vi.wordpress.org/?attachment_id=826\" class=\"wp-image-826\" srcset=\"https://vi.wordpress.org/files/2019/05/9-1024x576.jpg 1024w, https://vi.wordpress.org/files/2019/05/9-300x169.jpg 300w, https://vi.wordpress.org/files/2019/05/9-768x432.jpg 768w, https://vi.wordpress.org/files/2019/05/9.jpg 1600w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a></figure></li></ul>\n\n\n\n<p style=\"text-align:right\">Nguồn <a href=\"https://nhatrangwordpress.org/meetup/wordpress-translation-day-4-in-nha-trang.html\">WordPress Nha Trang</a></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:82:\"https://vi.wordpress.org/2019/05/13/wordpress-translation-day-4-in-nha-trang/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:64:\"\n		\n		\n				\n				\n		\n				\n		\n\n		\n				\n								\n							\n		\n							\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:43:\"Sài Gòn WordPress Meetup #27: WooCommerce\";s:7:\"attribs\";a:0:{}s:8:\"