.org/files/2019/04/20190417_202200.jpg\" target=\"_blank\" rel=\"noreferrer noopener\"><img src=\"https://vi.wordpress.org/files/2019/04/20190417_202200-1024x768.jpg\" alt=\"\" class=\"wp-image-805\" srcset=\"https://vi.wordpress.org/files/2019/04/20190417_202200-1024x768.jpg 1024w, https://vi.wordpress.org/files/2019/04/20190417_202200-300x225.jpg 300w, https://vi.wordpress.org/files/2019/04/20190417_202200-768x576.jpg 768w, https://vi.wordpress.org/files/2019/04/20190417_202200-440x330.jpg 440w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a></figure>\n\n\n\n<p>Vào lúc 18:30 ngày 17/04 vừa qua, Saigon WordPress Meetup lần thứ 27 đã được diễn ra với các chủ đề liên quan đến WooCommerce.</p>\n\n\n\n<span id=\"more-773\"></span>\n\n\n\n<p>Xem lại sự kiện trên Meetup.com</p>\n\n\n\n<figure class=\"wp-block-embed-meetup-com wp-block-embed is-type-rich is-provider-meetup\"><div class=\"wp-block-embed__wrapper\">\n<style type=\"text/css\">#meetup_oembed .mu_clearfix:after { visibility: hidden; display: block; font-size: 0; content: \" \"; clear: both; height: 0; }* html #meetup_oembed .mu_clearfix, *:first-child+html #meetup_oembed .mu_clearfix { zoom: 1; }#meetup_oembed { background:#eee;border:1px solid #ccc;padding:10px;-moz-border-radius:3px;-webkit-border-radius:3px;border-radius:3px;margin:0; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 12px; }#meetup_oembed h3 { font-weight:normal; margin:0 0 10px; padding:0; line-height:26px; font-family:Georgia,Palatino,serif; font-size:24px }#meetup_oembed p { margin: 0 0 10px; padding:0; line-height:16px; }#meetup_oembed img { border:none; margin:0; padding:0; }#meetup_oembed a, #meetup_oembed a:visited, #meetup_oembed a:link { color: #1B76B3; text-decoration: none; cursor: hand; cursor: pointer; }#meetup_oembed a:hover { color: #1B76B3; text-decoration: underline; }#meetup_oembed a.mu_button { font-size:14px; -moz-border-radius:3px;-webkit-border-radius:3px;border-radius:3px;border:2px solid #A7241D;color:white!important;text-decoration:none;background-color: #CA3E47; background-image: -moz-linear-gradient(top, #ca3e47, #a8252e); background-image: -webkit-gradient(linear, left bottom, left top, color-stop(0, #a8252e), color-stop(1, #ca3e47));disvplay:inline-block;padding:5px 10px; }#meetup_oembed a.mu_button:hover { color: #fff!important; text-decoration: none; }#meetup_oembed .photo { width:50px; height:50px; overflow:hidden;background:#ccc;float:left;margin:0 5px 0 0;text-align:center;padding:1px; }#meetup_oembed .photo img { height:50px }#meetup_oembed .number { font-size:18px; }#meetup_oembed .thing { text-transform: uppercase; color: #555; }</style><div id=\"meetup_oembed\" style=\"height:302px\">     <div style=\"max-height:262px;overflow:hidden\">          <h3>Saigon WordPress Meetup #27</h3>          <p style=\"margin:5px 0;font-size:16px\">Wednesday, Apr 17, 2019,  6:30 PM</p>          <p style=\"margin: 0 0 5px;\"><span style=\"font-size:14px\">Officience Vietnam</span><br /><span style=\"font-size:12px;\">16A Lê Hồng Phong, Phường 12, Quận 10 Thanh Pho Ho Chi Minh, VN</span></p>          <span style=\"color:#4F8A10;font-size:16px;\">80 WordPress Lovers Went</span>           <div style=\"margin:5px 0 10px\" class=\"mu_clearfix\">               <div class=\"photo\"><img src=\"https://secure.meetupstatic.com/photos/member/d/e/f/2/thumb_286917074.jpeg\" /></div><div class=\"photo\"><img src=\"https://secure.meetupstatic.com/photos/member/7/d/6/d/thumb_287192109.jpeg\" /></div><div class=\"photo\"><img src=\"https://secure.meetupstatic.com/photos/member/9/4/9/3/thumb_286958035.jpeg\" /></div><div class=\"photo\"><img src=\"https://secure.meetupstatic.com/photos/member/7/1/e/c/thumb_287249164.jpeg\" /></div><div class=\"photo\"><img src=\"https://secure.meetupstatic.com/photos/member/d/4/8/4/thumb_270534404.jpeg\" /></div><div class=\"photo\"><img src=\"https://secure.meetupstatic.com/photos/member/d/e/8/thumb_285543560.jpeg\" /></div><div class=\"photo\"><img src=\"https://secure.meetupstatic.com/photos/member/3/4/f/a/thumb_286873562.jpeg\" /></div><div class=\"photo\"><img src=\"https://secure.meetupstatic.com/photos/member/1/0/1/0/thumb_275824112.jpeg\" /></div><div class=\"photo\"><img src=\"https://secure.meetupstatic.com/photos/member/a/5/4/thumb_286922644.jpeg\" /></div><div class=\"photo\"><img src=\"https://secure.meetupstatic.com/photos/member/4/6/e/5/thumb_280458149.jpeg\" /></div>          </div>          <p style=\"line-height:16px\">(English is below) Thứ tư ngày 17/04, chúng ta sẽ gặp gỡ trong buổi Saigon WordPress meetup với các chủ đề sau: 1&#xfe0f;&#x20e3; Với sự trở lại của anh Jamie Madden, là Lead developer của plugin WC Vendors (https://www.wcvendors.com/). Anh sẽ chia sẻ về đề tài: WooCommerce và các cổng thanh toán online ở Việt Nam Các bạn có thể tìm hiểu thêm về Jamie qua link s&#8230;</p>     </div>     <p style=\"margin:10px 0 0;\"><a href=\"https://www.meetup.com/Saigon-WordPress/events/260335342/\" target=\"_blank\" class=\"mu_button\"><strong>Check out this Meetup &rarr;</strong></a></p></div>\n</div></figure>\n\n\n\n<h3>Chủ đề 1: WooCommerce và các cổng thanh toán tại Việt Nam</h3>\n\n\n\n<p>Chủ đề được chia sẻ bởi Jamie, là tác giả của plugin WC Vendors và cũng là Co-organizer của meetup. Trong chủ đề này, Jamie đã chia sẻ và giải đáp thắc mắc liên quan đến việc sử dụng các cổng thanh toán tại thị trường Việt Nam, những điểm mạnh, yếu của từng cổng thanh toán.</p>\n\n\n\n<figure class=\"wp-block-image\"><img src=\"https://vi.wordpress.org/files/2019/04/IMG_3565-1024x768.jpg\" alt=\"\" class=\"wp-image-784\" srcset=\"https://vi.wordpress.org/files/2019/04/IMG_3565-1024x768.jpg 1024w, https://vi.wordpress.org/files/2019/04/IMG_3565-300x225.jpg 300w, https://vi.wordpress.org/files/2019/04/IMG_3565-768x576.jpg 768w, https://vi.wordpress.org/files/2019/04/IMG_3565-440x330.jpg 440w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /><figcaption>Jamie đang chia sẻ về WooCommerce và các cổng thanh toán tại Việt Nam</figcaption></figure>\n\n\n\n<h3>Chủ đề 2: WooCommerce và Google Shopping</h3>\n\n\n\n<p>Chủ dề được chia sẻ bởi anh Mười Huỳnh. Chủ đề của anh liên quan đến việc bán hàng trên Google Shopping và cách tích hợp giữa 2 nền tảng WooCommerce và Google Shopping.</p>\n\n\n\n<figure class=\"wp-block-image\"><img src=\"https://vi.wordpress.org/files/2019/04/IMG_3572-1024x768.jpg\" alt=\"\" class=\"wp-image-785\" srcset=\"https://vi.wordpress.org/files/2019/04/IMG_3572-1024x768.jpg 1024w, https://vi.wordpress.org/files/2019/04/IMG_3572-300x225.jpg 300w, https://vi.wordpress.org/files/2019/04/IMG_3572-768x576.jpg 768w, https://vi.wordpress.org/files/2019/04/IMG_3572-440x330.jpg 440w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /><figcaption>Anh Mười Huỳnh đang chia sẻ về Google Shopping và WooCommerce</figcaption></figure>\n\n\n\n<h3>Địa điểm</h3>\n\n\n\n<p>Officience Vietnam : 16A Lê Hồng Phong, Phường 12, Quận 10</p>\n\n\n\n<figure class=\"wp-block-image\"><img src=\"https://vi.wordpress.org/files/2018/09/highres_466899254.png\" alt=\"\" class=\"wp-image-684\" srcset=\"https://vi.wordpress.org/files/2018/09/highres_466899254.png 1098w, https://vi.wordpress.org/files/2018/09/highres_466899254-300x211.png 300w, https://vi.wordpress.org/files/2018/09/highres_466899254-768x539.png 768w, https://vi.wordpress.org/files/2018/09/highres_466899254-1024x719.png 1024w\" sizes=\"(max-width: 1098px) 100vw, 1098px\" /></figure>\n\n\n\n<h3>Tìm speaker</h3>\n\n\n\n<p>Một trong những khó khăn của tụi mình đó là tìm kiếm người để chia sẻ cho meetup, vì có người chia sẻ thì mới có thể tổ chức meetup được. Vì vậy mong các bạn cùng đóng góp bằng cách đăng ký chủ đề mà bạn muốn nói ở phần comment, hoặc gửi email về địa chỉ: nguyenvanduocit@gmail.com</p>\n\n\n\n<h3>Tài trợ</h3>\n\n\n\n<p>Xin cảm ơn tới:</p>\n\n\n\n<ul><li><strong><a href=\"https://officience.com/en?utm_source=wordpress_saigon&amp;ref=worddpress_saigon\">Officience Vietnam</a></strong> đã luôn đồng hành và hỗ trợ địa điểm cho meetup.</li><li><strong><a href=\"https://weglot.com/?utm_source=wordpress_saigon&amp;ref=worddpress_saigon\">Weglot</a></strong> đã hỗ trợ kinh phí cho thức ăn.</li></ul>\n\n\n\n<h3>Một vài hình ảnh liên quan</h3>\n\n\n\n<ul class=\"wp-block-gallery columns-3 is-cropped\"><li class=\"blocks-gallery-item\"><figure><a href=\"https://vi.wordpress.org/files/2019/04/IMG_3577-1024x1024.jpg\"><img src=\"https://vi.wordpress.org/files/2019/04/IMG_3577-1024x1024.jpg\" alt=\"\" data-id=\"788\" data-link=\"https://vi.wordpress.org/?attachment_id=788\" class=\"wp-image-788\" srcset=\"https://vi.wordpress.org/files/2019/04/IMG_3577-1024x1024.jpg 1024w, https://vi.wordpress.org/files/2019/04/IMG_3577-150x150.jpg 150w, https://vi.wordpress.org/files/2019/04/IMG_3577-300x300.jpg 300w, https://vi.wordpress.org/files/2019/04/IMG_3577-768x768.jpg 768w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a></figure></li><li class=\"blocks-gallery-item\"><figure><a href=\"https://vi.wordpress.org/files/2019/04/IMG_3564-1024x768.jpg\"><img src=\"https://vi.wordpress.org/files/2019/04/IMG_3564-1024x768.jpg\" alt=\"\" data-id=\"789\" data-link=\"https://vi.wordpress.org/?attachment_id=789\" class=\"wp-image-789\" srcset=\"https://vi.wordpress.org/files/2019/04/IMG_3564-1024x768.jpg 1024w, https://vi.wordpress.org/files/2019/04/IMG_3564-300x225.jpg 300w, https://vi.wordpress.org/files/2019/04/IMG_3564-768x576.jpg 768w, https://vi.wordpress.org/files/2019/04/IMG_3564-440x330.jpg 440w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a></figure></li><li class=\"blocks-gallery-item\"><figure><a href=\"https://vi.wordpress.org/files/2019/04/IMG_3565-1-1024x768.jpg\"><img src=\"https://vi.wordpress.org/files/2019/04/IMG_3565-1-1024x768.jpg\" alt=\"\" data-id=\"790\" data-link=\"https://vi.wordpress.org/?attachment_id=790\" class=\"wp-image-790\" srcset=\"https://vi.wordpress.org/files/2019/04/IMG_3565-1-1024x768.jpg 1024w, https://vi.wordpress.org/files/2019/04/IMG_3565-1-3