\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:58:\"Mời dịch tiếng Việt cho WordPress phiên bản 5.2\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:84:\"https://vi.wordpress.org/2019/04/12/moi-dich-tieng-viet-cho-wordpress-phien-ban-5-2/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:92:\"https://vi.wordpress.org/2019/04/12/moi-dich-tieng-viet-cho-wordpress-phien-ban-5-2/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 12 Apr 2019 03:45:23 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:11:\"Thông báo\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:16:\"Dịch WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://vi.wordpress.org/?p=769\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:340:\"Phiên bản WordPress 5.2 dự kiến ra mắt ngày 30/04/2019. Và bạn hoàn toàn có thể đóng góp để nó hỗ trợ tiếng Việt hoàn chỉnh từ ngay hôm nay. Hiện tại số lượng từ chưa dịch trong phiên bản WordPress 5.2 vẫn còn khá nhiều (hơn 100 từ ở bên ngoài frontend và hơn [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"Kevin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1448:\"\n<p>Phiên bản WordPress 5.2 dự kiến ra mắt ngày 30/04/2019. Và bạn hoàn toàn có thể đóng góp để nó hỗ trợ tiếng Việt hoàn chỉnh từ ngay hôm nay.</p>\n\n\n\n<span id=\"more-769\"></span>\n\n\n\n<p>Hiện tại số lượng từ chưa dịch trong phiên bản WordPress 5.2 vẫn còn khá nhiều (hơn 100 từ ở bên ngoài frontend và hơn 300 từ ở trong phần Quản trị).</p>\n\n\n\n<p>Bởi vậy, rất mong sự tham gia của các bạn tình nguyện viên giúp hoàn chỉnh bản dịch tiếng Việt.</p>\n\n\n\n<p>Hướng dẫn tham gia đóng góp cho WordPress:</p>\n\n\n\n<ul><li>Truy cập <a href=\"https://translate.wordpress.org/locale/vi/default/wp/dev/\">địa chỉ</a> chứa bản dịch WordPress tiếng Việt.</li><li>Trên góc trên bên phải, click vào nút Register để đăng ký tài khoản (nếu đã có tài khoản, bạn nhấp vào Login).</li><li>Sau khi đăng ký và xác nhận email, bạn sẽ có thể bắt đầu dịch.</li></ul>\n\n\n\n<p>Bạn có thể bắt đầu dịch bằng một trong hai liên kết sau, nhấp vào phần &#8220;Untranslated&#8221;:</p>\n\n\n\n<p><a href=\"https://translate.wordpress.org/projects/wp/dev/vi/default/\">5.2.x &#8211; Development</a><br><a href=\"https://translate.wordpress.org/projects/wp/dev/admin/vi/default/\">5.2.x &#8211; Administration</a></p>\n\n\n\n<p>Rất hi vọng nhận được đóng góp của các bạn.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:89:\"https://vi.wordpress.org/2019/04/12/moi-dich-tieng-viet-cho-wordpress-phien-ban-5-2/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:64:\"\n		\n		\n				\n				\n		\n				\n		\n\n		\n				\n								\n							\n		\n							\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"Meetup tháng 03 tại Nha Trang\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:66:\"https://vi.wordpress.org/2019/04/01/meetup-thang-03-tai-nha-trang/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:75:\"https://vi.wordpress.org/2019/04/01/meetup-thang-03-tai-nha-trang/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 01 Apr 2019 02:21:23 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:6:\"Meetup\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:9:\"Nha Trang\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://vi.wordpress.org/?p=755\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:373:\"Sáng ngày 31/03/2019 cộng đồng Nha Trang WordPress (NTWP) đã tổ chức buổi meetup &#8220;Nha Trang WordPress Meetup Tháng 03/2019&#8221; Nha Trang WordPress Meetup Tháng 03/2019 là sự kiện đầu tiên của năm 2019 của cộng đồng NTWP, tạo tiền đề cho các sự kiện lớn hơn trong năm như WordPress Translation Day 4 in [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Dat Hoang\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:5726:\"\n<figure class=\"wp-block-image\"><img src=\"https://vi.wordpress.org/files/2019/04/55731112_1303937263080971_3029205958166315008_o-1024x768.jpg\" alt=\"\" class=\"wp-image-762\" srcset=\"https://vi.wordpress.org/files/2019/04/55731112_1303937263080971_3029205958166315008_o-1024x768.jpg 1024w, https://vi.wordpress.org/files/2019/04/55731112_1303937263080971_3029205958166315008_o-300x225.jpg 300w, https://vi.wordpress.org/files/2019/04/55731112_1303937263080971_3029205958166315008_o-768x576.jpg 768w, https://vi.wordpress.org/files/2019/04/55731112_1303937263080971_3029205958166315008_o-440x330.jpg 440w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></figure>\n\n\n\n<p>Sáng ngày 31/03/2019 cộng đồng Nha Trang WordPress (NTWP) đã tổ chức buổi meetup &#8220;Nha Trang WordPress Meetup Tháng 03/2019&#8221;</p>\n\n\n\n<p>Nha Trang WordPress Meetup Tháng 03/2019 là sự kiện đầu tiên của năm 2019 của cộng đồng NTWP, tạo tiền đề cho các sự kiện lớn hơn trong năm như <a href=\"https://www.facebook.com/events/2219567564770565/\">WordPress Translation Day 4 in Nha Trang</a> vào tháng 5/2019.</p>\n\n\n\n<span id=\"more-755\"></span>\n\n\n\n<p>Chủ đề của buổi meetup tháng 3/2019 chủ yếu thảo luận xoay quanh chủ đề dọn dẹp hình ảnh thừa, ảnh không sử dụng trong WordPress và các cách tối ưu, nén ảnh hiệu quả với WordPress.</p>\n\n\n\n<p>Nha Trang WordPress xin gửi lời cám ơn chân thành đến nhà tài trợ <code>Bạch Kim - bkns.vn</code> đã hỗ trợ cộng đồng Nha Trang WordPress mã giảm giá hosting WordPress chất lượng cao hoàn toàn miễn phí trong 03 tháng.</p>\n\n\n\n<p>Ban tổ chức cũng gửi lời cảm ơn sâu sắc đến toàn thể các anh chị đã dành thời gian tham dự buổi meetup sáng nay. Xin hẹn gặp lại mọi người vào sự kiện Nha Trang WordPress Meetup tháng 4/2019.</p>\n\n\n\n<ul class=\"wp-block-gallery columns-3 is-cropped\"><li class=\"blocks-gallery-item\"><figure><img src=\"https://vi.wordpress.org/files/2019/04/55686694_1303937549747609_9117521704556429312_o-1024x768.jpg\" alt=\"\" data-id=\"756\" data-link=\"https://vi.wordpress.org/?attachment_id=756\" class=\"wp-image-756\" srcset=\"https://vi.wordpress.org/files/2019/04/55686694_1303937549747609_9117521704556429312_o-1024x768.jpg 1024w, https://vi.wordpress.org/files/2019/04/55686694_1303937549747609_9117521704556429312_o-300x225.jpg 300w, https://vi.wordpress.org/files/2019/04/55686694_1303937549747609_9117521704556429312_o-768x576.jpg 768w, https://vi.wordpress.org/files/2019/04/55686694_1303937549747609_9117521704556429312_o-440x330.jpg 440w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"https://vi.wordpress.org/files/2019/04/56161590_1303937393080958_2786779698829459456_o-1024x768.jpg\" alt=\"\" data-id=\"757\" data-link=\"https://vi.wordpress.org/?attachment_id=757\" class=\"wp-image-757\" srcset=\"https://vi.wordpress.org/files/2019/04/56161590_1303937393080958_2786779698829459456_o-1024x768.jpg 1024w, https://vi.wordpress.org/files/2019/04/56161590_1303937393080958_2786779698829459456_o-300x225.jpg 300w, https://vi.wordpress.org/files/2019/04/56161590_1303937393080958_2786779698829459456_o-768x576.jpg 768w, https://vi.wordpress.org/files/2019/04/56161590_1303937393080958_2786779698829459456_o-440x330.jpg 440w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"https://vi.wordpress.org/files/2019/04/55916059_1303937443080953_5097690558999035904_o-1024x768.jpg\" alt=\"\" data-id=\"758\" data-link=\"https://vi.wordpress.org/?attachment_id=758\" class=\"wp-image-758\" srcset=\"https://vi.wordpress.org/files/2019/04/55916059_1303937443080953_5097690558999035904_o-1024x768.jpg 1024w, https://vi.wordpress.org/files/2019/04/55916059_1303937443080953_5097690558999035904_o-300x225.jpg 300w, https://vi.wordpress.org/files/2019/04/55916059_1303937443080953_5097690558999035904_o-768x576.jpg 768w, https://vi.wordpress.org/files/2019/04/55916059_1303937443080953_5097690558999035904_o-440x330.jpg 440w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"https://vi.wordpress.org/files/2019/04/55674567_1303937313080966_7989586249503473664_o-1024x768.jpg\" alt=\"\" data-id=\"759\" data-link=\"https://vi.wordpress.org/?attachment_id=759\" class=\"wp-image-759\" srcset=\"https://vi.wordpress.org/files/2019/04/55674567_1303937313080966_7989586249503473664_o-1024x768.jpg 1024w, https://vi.wordpress.org/files/2019/04/55674567_1303937313080966_7989586249503473664_o-300x225.jpg 300w, https://vi.wordpress.org/files/2019/04/55674567_1303937313080966_7989586249503473664_o-768x576.jpg 768w, https://vi.wordpress.org/files/2019/04/55674567_1303937313080966_7989586249503473664_o-440x330.jpg 440w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></figure></li><li class=\"blocks-gallery-item\"><figure><img src=\"https://vi.wordpress.org/files/2019/04/55692788_1303937219747642_4978768828742762496_o-1024x768.jpg\" alt=\"\" data-id=\"760\" data-link=\"https://vi.wordpress.org/?attachment_id=760\" class=\"wp-image-760\" srcset=\"https://vi.wordpress.org/files/2019/04/55692788_1303937219747642_4978768828742762496_o-1024x768.jpg 1024w, https://vi.wordpress.org/files/2019/04/55692788_1303937219747642_4978768828742762496_o-300x225.jpg 300w, https://vi.wordpress.org/files/2019/