ang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:6:\"Meetup\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:22:\"Hanoi WordPress Meetup\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://vi.wordpress.org/?p=739\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:348:\"Đây sẽ là meetup cuối cùng của năm 2018. Meetup sẽ dành thời gian để chia sẻ về Gutenberg (hay Block Editor), trở thành editor mặc định từ WordPress 5.0.&#160; Địa điểm Văn phòng Solis LabTầng 3, Toà nhà Anh Minh, 36 phố Hoàng Cầu&#8211; Vui lòng gửi xe ở phía sau toà nhà. Thời [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"Kevin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1510:\"\n<p>Đây sẽ là meetup cuối cùng của năm 2018. Meetup sẽ dành thời gian để chia sẻ về Gutenberg (hay Block Editor), trở thành editor mặc định từ WordPress 5.0.&nbsp;</p>\n\n\n\n<span id=\"more-739\"></span>\n\n\n\n<h3>Địa điểm</h3>\n\n\n\n<p>Văn phòng Solis Lab<br>Tầng 3, Toà nhà Anh Minh, 36 phố Hoàng Cầu<br>&#8211; Vui lòng gửi xe ở phía sau toà nhà.</p>\n\n\n\n<h3>Thời gian</h3>\n\n\n\n<p><strong>Từ 18.30 đến 20.00<br>Thứ tư, 26/12/2018</strong></p>\n\n\n\n<h3>Chương trình dự kiến</h3>\n\n\n\n<p>18.30 &#8211; 19.00: Ứng dựng Gutenberg trên sản phẩm thực tế &#8211; trình bày bởi <a href=\"https://www.facebook.com/vunamhung\" target=\"_blank\" rel=\"noreferrer noopener\" aria-label=\"Vũ Nam Hưng (opens in a new tab)\">Vũ Nam Hưng</a> (Insight Studio)</p>\n\n\n\n<p>19.00 &#8211; 19.30 Thực nghiệm chuyển đổi website sử dụng Page Builder sang Gutenberg &#8211; trình bày bởi&nbsp;<a target=\"_blank\" href=\"https://www.facebook.com/khoiprodotcom\" rel=\"noreferrer noopener\">Nguyễn Minh Khôi</a>&nbsp;(Solis Lab)&nbsp;</p>\n\n\n\n<p>19.30 &#8211; 20.00 Chia sẻ các vấn đề khác liên quan tới WordPress.&nbsp;</p>\n\n\n\n<p>**Bạn nào có topic muốn chia sẻ thì comment ở dưới nhé.**</p>\n\n\n\n<p>Cảm ơn Solis Lab tiếp tục hỗ trợ địa điểm cho meetup lần này <img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/2764.png\" alt=\"❤\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:79:\"https://vi.wordpress.org/2018/12/21/wordpress-meetup-ha-noi-thang-12-2018/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:61:\"\n		\n		\n				\n				\n		\n				\n\n		\n				\n								\n							\n		\n							\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:28:\"Phiên bản WordPress 5.0.2\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:62:\"https://vi.wordpress.org/2018/12/20/phien-ban-wordpress-5-0-2/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:70:\"https://vi.wordpress.org/2018/12/20/phien-ban-wordpress-5-0-2/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 20 Dec 2018 02:42:27 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Tin tức\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://vi.wordpress.org/?p=735\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:324:\"Phiên bản nâng cấp WordPress này cung cấp bản vá cho 73 lỗi. Mục tiêu chính của các bản vá ngay sau khi bản 5.0 ra đời là tối ưu hóa trải nghiệm và tốc độ cho các block trong trình soạn thảo mới Gutenberg đạt tới 330% với hơn 200 block. Thống kê nhanh [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"Kevin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:979:\"\n<figure class=\"wp-block-image\"><img src=\"https://img.shields.io/badge/wpvi-5.0.2-blue.svg\" alt=\"\" /></figure>\n\n\n\n<p>Phiên bản nâng cấp WordPress này cung cấp bản vá cho 73 lỗi. Mục tiêu chính của các bản vá ngay sau khi bản 5.0 ra đời là tối ưu hóa trải nghiệm và tốc độ cho các block trong trình soạn thảo mới Gutenberg đạt tới 330% với hơn 200 block.</p>\n\n\n\n<span id=\"more-735\"></span>\n\n\n\n<h2>Thống kê nhanh về bản patch WordPress 5.0.2</h2>\n\n\n\n<ul><li>Khắc phục 45 lỗi với Block, trong đó có 14 vấn đề về hiệu suất và 31 vấn đề là bug fix.</li><li>17 lỗi liên quan tới Block khác cũng đã được sửa.</li><li>Một số vấn đề đa ngôn ngữ khi tải script cũng đã khắc phục</li></ul>\n\n\n\n<p>Bạn có thể tải về tại trang <a href=\"https://vi.wordpress.org/download/\">Downloads</a> hoặc nâng cấp trong Trang quản trị của website.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"https://vi.wordpress.org/2018/12/20/phien-ban-wordpress-5-0-2/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:61:\"\n		\n		\n				\n				\n		\n				\n\n		\n				\n								\n							\n		\n							\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:24:\"WordPress 5.0 “Bebo”\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"https://vi.wordpress.org/2018/12/07/wordpress-5-0-bebo/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:63:\"https://vi.wordpress.org/2018/12/07/wordpress-5-0-bebo/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 07 Dec 2018 09:40:19 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:17:\"Bản nâng cấp\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://vi.wordpress.org/?p=727\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:379:\"Gutenberg đã chính thức phát hành cùng phiên bản WordPress 5.0 vào ngày 06/12/2018. Sau đây là những điểm đáng lưu ý của phiên bản có cải tiến đáng kể này. Xây dựng nội dung đa dạng hơn với &#8220;Block&#8221; Gutenberg cung cấp trải nghiệm về &#8220;block&#8221; (khối) rõ ràng hơn về mặt bố cục. [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"Kevin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3694:\"\n<figure class=\"wp-block-image\"><img src=\"https://vi.wordpress.org/files/2018/12/wp-gutenberg.jpg\" alt=\"\" class=\"wp-image-731\" srcset=\"https://vi.wordpress.org/files/2018/12/wp-gutenberg.jpg 768w, https://vi.wordpress.org/files/2018/12/wp-gutenberg-300x150.jpg 300w\" sizes=\"(max-width: 768px) 100vw, 768px\" /></figure>\n\n\n\n<figure class=\"wp-block-image\"><img src=\"https://img.shields.io/badge/wpvi-5.0-blue.svg\" alt=\"\" /></figure>\n\n\n\n<p>Gutenberg đã chính thức phát hành cùng phiên bản WordPress 5.0 vào ngày 06/12/2018. Sau đây là những điểm đáng lưu ý của phiên bản có cải tiến đáng kể này.</p>\n\n\n\n<span id=\"more-727\"></span>\n\n\n\n<h2>Xây dựng nội dung đa dạng hơn với &#8220;Block&#8221;</h2>\n\n\n\n<p>Gutenberg cung cấp trải nghiệm về &#8220;block&#8221; (khối) rõ ràng hơn về mặt bố cục. Thay vì một nội dung tràn cứng, nay bạn đã có thể chia cột, thêm media, thêm các tuỳ biến nội dung mới cho bài viết phong phú hơn, bao gồm cả &#8220;thơ&#8221;. Mỗi loại nội dung bản thân sẽ là một &#8220;block&#8221;.</p>\n\n\n\n<h2>Danh sách các khối đã hỗ trợ</h2>\n\n\n\n<figure class=\"wp-block-image\"><img src=\"https://vi.wordpress.org/files/2018/12/wordpress-gutenberg-blocks.png\" alt=\"\" class=\"wp-image-730\" srcset=\"https://vi.wordpress.org/files/2018/12/wordpress-gutenberg-blocks.png 702w, https://vi.wordpress.org/files/2018/12/wordpress-gutenberg-blocks-300x288.png 300w\" sizes=\"(max-width: 702px) 100vw, 702px\" /></figure>\n\n\n\n<p>Ngoài những block cung cấp sẵn, tính năng &#8220;Block tái sử dụng&#8221; cũng đã có mặt, cho phép bạn tạo các khối tuỳ biến riêng của mình và tái sử dụng nó tại các trang khác dễ dàng.</p>\n\n\n\n<h2>Giao diện mới Twenty Nineteen</h2>\n\n\n\n<p>Giao diện do nhóm Core phát triển nhằm phát huy tất cả sức mạnh của Gutenberg. Trông dễ nhìn, bố cục tối giản nhưng không kém phần hiện đại.</p>\n\n\n\n<figure class=\"wp-block-image\"><img src=\"https://vi.wordpress.org/files/2018/12/twenty-nineteen.jpg\" alt=\"\" class=\"wp-image-729\" srcset=\"https://vi.wordpress.org/files/2018/12/twenty-nineteen.jpg 768w, https://vi.wordpress.org/files/2018/12/twenty-nineteen-300x200.jpg 300w\" sizes=\"(max-width: 768px) 100vw, 768px\" /></figure>\n\n\n\n<p>Nếu bạn quan tâm và muốn tham gia dịch giao diện này, hãy làm <a rel=\"noreferrer noopener\" aria-label=\"Nếu bạn quan tâm và muốn tham gia dịch giao diện này, hãy làm tại đây nhé.   (opens in a new tab)\" href=\"https://translate.wordpress.org/locale/vi/default/wp-themes/twentynineteen\" target=\"_blank\">tại đây</a> nhé.  </p>\n\n\n\n<h2>Bạn chưa sẵn sàng sử dụng Gutenberg?</h2>\n\n\n\n<p>Hãy tải <a href=\"https://vi.wordpress.org/plugins/classic-editor/\" target=\"_blank\" rel=\"noreferrer noopener\" aria-label=\"Hãy tải plugin Classic Editor về và cài vào, Gutenberg sẽ không còn hoạt động trên website của bạn nữa nhé.\n (opens in a new tab)\">plugin Classic Editor</a> về và cài vào, Gutenberg sẽ không còn hoạt động trên website của bạn nữa nhé.<br></p>\n\n\n\n<h2>Các tài liệu tham khảo dành cho Gutenberg<br></h2>\n\n\n\n<p>Dành cho lập trình viên: <a rel=\"noreferrer noopener\" aria-label=\"Dành cho lập trình viên: Gutenberg Handbook\n (opens in a new tab)\" href=\"https://wordpress.org/gutenberg/handbook/\" target=\"_blank\">Gutenberg Handbook</a></p>\n\n\n\n<p><em>Nguồn: </em><a rel=\"noreferrer noopener\" aria-label=\"Nguồn: WPHub (opens in a new tab)\" href=\"https://wphub.vn/wordpress50/\" target=\"_blank\"><em>WPHub</em></a></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:60:\"https://vi.wordpress.org/2018/12/07/wordpress-5-0-bebo/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:7;a:6:{s:4:\"data\";s:64:\"\n		\n		\n				\n				\n		\n				\n		\n\n		\n				\n								\n							\n		\n							\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:47:\"WordPress Meetup tháng 10/2018 tại Nha Trang\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:81:\"https://vi.wordpress.org/2018/10/15/wordpress-meetup-thang-10-2018-tai-nha-