=AT03S0GCxKcCgkuUcIGKadENEiAAdprfxa60dHxbOK9qNvIcgXB9OdglkWSHJAmqFsLovy7meJPVbwDUjHc6dVLq9ixH3rhNQHr_hlrWoIT1fNM4F29oy9senLJIrvrsFEEi\" rel=\"noreferrer noopener\">https://goo.gl/forms/DCWVInHFgtWg2GPg2</a></p>\n\n\n\n<p><img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f4e2.png\" alt=\"📢\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> FAQ<br>&#8211;\n Nha Trang WordPress Meetup là hoạt động offline hàng tháng nhằm phát \ntriển cộng đồng yêu thích và sử dụng WordPress tại Nha Trang<br>&#8211; Nha Trang WordPress Meetup là chương trình hoàn toàn miễn phí, không thu phí vào cổng đối với người tham gia.<br>&#8211; Nha Trang WordPress Meetup lấy chi phí tổ chức từ nhà tài trợ hoặc quyên góp từ thành viên tham dự.\n\n</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:86:\"https://vi.wordpress.org/2018/10/15/wordpress-meetup-thang-10-2018-tai-nha-trang/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:8;a:6:{s:4:\"data\";s:61:\"\n		\n		\n				\n				\n		\n				\n\n		\n				\n								\n							\n		\n							\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:47:\"WordPress Meetup tháng 09/2018 tại Nha Trang\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:81:\"https://vi.wordpress.org/2018/09/07/wordpress-meetup-thang-09-2018-tai-nha-trang/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:90:\"https://vi.wordpress.org/2018/09/07/wordpress-meetup-thang-09-2018-tai-nha-trang/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 07 Sep 2018 07:25:34 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Tin tức\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://vi.wordpress.org/?p=692\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:353:\"Ngày 23 28 tháng 09 năm 2018 Cộng đồng Nha Trang WordPress sẽ tổ chức một buổi meetup để toàn thể các fan yêu thích WordPress tại Nha Trang có thể giao lưu trao đổi kinh nghiệm sử dụng WordPress. Thời gian: 08h30 sáng ngày 28/09/2018 Địa điểm: Công Ty CP Giáo Dục Việt Nam &#8211; CN [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"Kevin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:7239:\"\n<p>Ngày <del>23</del> 28 tháng 09 năm 2018 Cộng đồng Nha Trang WordPress sẽ tổ chức một buổi meetup để toàn thể các fan yêu thích WordPress tại Nha Trang có thể giao lưu trao đổi kinh nghiệm sử dụng WordPress.</p>\n\n\n\n<figure class=\"wp-block-image\"><img src=\"https://vi.wordpress.org/files/2018/09/nha-trang.png\" alt=\"\" class=\"wp-image-715\" srcset=\"https://vi.wordpress.org/files/2018/09/nha-trang.png 2048w, https://vi.wordpress.org/files/2018/09/nha-trang-300x184.png 300w, https://vi.wordpress.org/files/2018/09/nha-trang-768x470.png 768w, https://vi.wordpress.org/files/2018/09/nha-trang-1024x627.png 1024w\" sizes=\"(max-width: 2048px) 100vw, 2048px\" /></figure>\n\n\n\n<span id=\"more-692\"></span>\n\n\n\n<ul><li><strong>Thời gian:</strong> 08h30 sáng ngày 28/09/2018</li><li><strong>Địa điểm:</strong> Công Ty CP Giáo Dục Việt Nam &#8211; CN Nha Trang, 33 Đường B1, KĐT Vĩnh Điềm Trung, Nha Trang.</li></ul>\n\n\n\n<ul><li><strong><del>Thời gian:</del></strong><del> 08h30 sáng ngày 23/09/2018</del></li><li><del><strong>Địa điểm:</strong> EVi cafe &amp; co-working space &#8211; 48 Lý Thánh Tôn, Tp,Nha Trang</del></li></ul>\n\n\n\n<p>Với\n mong muốn chương trình mang tính kết nối cộng đồng hơn, BTC rất mong \ncác bạn có thể dành thời gian đăng ký làm diễn giả để chia sẻ với mọi \nngười những kinh nghiệm, thủ thuật trong quá trình sử dụng WordPress của\n mình đến với mọi người. Các bạn có thể chia sẻ bất cứ chủ để gì, miễn \nlà liên quan đến WordPress đều được.</p>\n\n\n\n<h3><img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f4e2.png\" alt=\"📢\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> CHỦ ĐỀ:</h3>\n\n\n\n<ol><li>Progressive Web App và ứng dụng vào WordPress<br />\nTrình bày: Mr.Minh &#8211; Minh Duy Solutions</li><li>Xây Dựng Ứng Dụng Bán Hàng Trực Tuyến Trên Android Với WordPress, Woocommerce và Ionic Framework<br />\nTrình bày: Mr. Bảo Lộc &#8211; Tripaway</li><li>Một Số Giải Pháp Dựng Landing Page Nhanh Với WordPress – Minh Nguyễn &#8211; Minh Duy Solutions</li></ol>\n\n\n\n<p>Để đăng ký làm tham gia meetup, vui lòng đăng ký qua link sau:<br /><a target=\"_blank\" href=\"https://goo.gl/forms/3GUYDUspni1kVjRQ2\" rel=\"noreferrer noopener\">https://goo.gl/forms/3GUYDUspni1kVjRQ2</a></p>\n\n\n\n<p>Ngoài ra, bạn có thể theo dõi thông tin về sự kiện qua: </p>\n\n\n\n<p>Meetup.com: </p>\n\n\n\n<figure class=\"wp-block-embed-meetup-com wp-block-embed is-type-rich is-provider-meetup\"><div class=\"wp-block-embed__wrapper\">\n<style type=\"text/css\">#meetup_oembed .mu_clearfix:after { visibility: hidden; display: block; font-size: 0; content: \" \"; clear: both; height: 0; }* html #meetup_oembed .mu_clearfix, *:first-child+html #meetup_oembed .mu_clearfix { zoom: 1; }#meetup_oembed { background:#eee;border:1px solid #ccc;padding:10px;-moz-border-radius:3px;-webkit-border-radius:3px;border-radius:3px;margin:0; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 12px; }#meetup_oembed h3 { font-weight:normal; margin:0 0 10px; padding:0; line-height:26px; font-family:Georgia,Palatino,serif; font-size:24px }#meetup_oembed p { margin: 0 0 10px; padding:0; line-height:16px; }#meetup_oembed img { border:none; margin:0; padding:0; }#meetup_oembed a, #meetup_oembed a:visited, #meetup_oembed a:link { color: #1B76B3; text-decoration: none; cursor: hand; cursor: pointer; }#meetup_oembed a:hover { color: #1B76B3; text-decoration: underline; }#meetup_oembed a.mu_button { font-size:14px; -moz-border-radius:3px;-webkit-border-radius:3px;border-radius:3px;border:2px solid #A7241D;color:white!important;text-decoration:none;background-color: #CA3E47; background-image: -moz-linear-gradient(top, #ca3e47, #a8252e); background-image: -webkit-gradient(linear, left bottom, left top, color-stop(0, #a8252e), color-stop(1, #ca3e47));disvplay:inline-block;padding:5px 10px; }#meetup_oembed a.mu_button:hover { color: #fff!important; text-decoration: none; }#meetup_oembed .photo { width:50px; height:50px; overflow:hidden;background:#ccc;float:left;margin:0 5px 0 0;text-align:center;padding:1px; }#meetup_oembed .photo img { height:50px }#meetup_oembed .number { font-size:18px; }#meetup_oembed .thing { text-transform: uppercase; color: #555; }</style><div id=\"meetup_oembed\" style=\"height:302px\">     <div style=\"max-height:262px;overflow:hidden\">          <h3>Nha Trang WordPress Meetup Tháng 9/2018</h3>          <p style=\"margin:5px 0;font-size:16px\">Friday, Sep 28, 2018,  8:30 AM</p>          <p style=\"margin: 0 0 5px;\"><span style=\"font-size:14px\">Trung Tâm Đào Tạo Nghề &#8211; Trường Cao Đẳng Văn Lang</span><br /><span style=\"font-size:12px;\">Số 33 đường B1 Nha Trang, ks</span></p>          <span style=\"color:#4F8A10;font-size:16px;\">4 Thành viên Attending</span>           <div style=\"margin:5px 0 10px\" class=\"mu_clearfix\">               <div class=\"photo\"><img src=\"https://secure.meetupstatic.com/photos/member/2/0/b/7/thumb_280868375.jpeg\" /></div><div class=\"photo\"><img src=\"https://secure.meetupstatic.com/photos/member/7/8/b/2/thumb_280950898.jpeg\" /></div><div class=\"photo\"><img src=\"https://secure.meetupstatic.com/photos/member/6/c/e/f/thumb_278847887.jpeg\" /></div><div class=\"photo\"><img src=\"https://secure.meetupstatic.com/photos/member/9/f/b/c/thumb_227920892.jpeg\" /></div>          </div>          <p style=\"line-height:16px\">Xin chào toàn thể các bạn yêu mến WordPress tại Nha Trang! Ngày 28 tháng 09 năm 2018 Cộng đồng Nha Trang WordPress sẽ tổ chức một buổi meetup để toàn thể các fan yêu thích WordPress tại Nha Trang có thể giao lưu trao đổi kinh nghiệm sử dụng WordPress. <img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/2728.png\" alt=\"✨\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> Thời gian: 08h30 sáng ngày 28/09/2018 <img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/2728.png\" alt=\"✨\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> Địa điểm: Công Ty CP Giáo Dục Việt Nam &#8211; CN Nha Trang Số&#8230;</p>     </div>     <p style=\"margin:10px 0 0;\"><a href=\"https://www.meetup.com/Nha-Trang-WordPress/events/253995703/\" target=\"_blank\" class=\"mu_button\"><strong>Check out this Meetup &rarr;</strong></a></p></div>\n</div><figcaption>Theo dõi sự kiện qua Meetup.com</figcaption></figure>\n\n\n\n<p>Hoặc qua Facebook Event: <a href=\"https://www.facebook.com/events/247276932596305/\">https://www.facebook.com/events/247276932596305/</a></p>\n\n\n\n<p>Xin trân trọng cảm ơn!</p>\n\n\n\n<h4>Câu hỏi thường gặp</h4>\n\n\n\n<p>&#8211; Nha Trang WordPress Meetup là hoạt động offline hàng tháng nhằm phát triển cộng đồng yêu thích và sử dụng WordPress tại Nha Trang<br />&#8211; Nha Trang WordPress Meetup là chương trình hoàn toàn miễn phí, không thu phí vào cổng đối với người tham gia.<br />&#8211; Nha Trang WordPress Meetup lấy chi phí tổ chức từ nhà tài trợ hoặc quyên góp từ thành viên tham dự.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:86:\"https://vi.wordpress.org/2018/09/07/wordpress-meetup-thang-09-2018-tai-nha-trang/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"2\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:64:\"\n		\n		\n				\n				\n		\n				\n		\n\n		\n				\n								\n							\n		\n							\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:47:\"WordPress Meetup tháng 09/2018 tại Hà Nội\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:78:\"https://vi.wordpress.org/2018/09/07/wordpress-meetup-thang-09-2018-tai-ha-noi/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:86:\"https://vi.wordpress.org/2018/09/07/wordpress-meetup-thang-09-2018-tai-ha-noi/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Fri, 07 Sep 2018 04:45:50 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:6:\"Meetup\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:22:\"Hanoi WordPress Meetup\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"https://vi.wordpress.org/?p=688\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:333:\"Mùa thu tại Hà Nội thật đẹp và ấm áp. Và đó cũng là thời điểm chúng tôi cho rằng những người yêu mến #WordPress tại Hà Nội nên dành thời gian gặp gỡ, trao đổi và chia sẻ cho nhau biết những trải nghiệm mới nhất của mình. Chúng tôi hi vọng bạn có [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:5:\"Kevin\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:5840:\"\n<figure class=\"wp-block-image\"><img src=\"https://vi.wordpress.org/files/2018/09/20_motorboat.jpg\" alt=\"\" class=\"wp-image-690\" srcset=\"https://vi.wordpress.org/files/2018/09/20_motorboat.jpg 1200w, https://vi.wordpress.org/files/2018/09/20_motorboat-300x75.jpg 300w, https://vi.wordpress.org/files/2018/09/20_motorboat-768x192.jpg 768w, https://vi.wordpress.org/files/2018/09/20_motorboat-1024x256.jpg 1024w\" sizes=\"(max-width: 1200px) 100vw, 1200px\" /><figcaption>(Ảnh: Google Forms)</figcaption></figure>\n\n\n\n<p>Mùa thu tại Hà Nội thật đẹp và ấm áp. Và đó cũng là thời điểm chúng tôi cho rằng những người yêu mến #WordPress tại Hà Nội nên dành thời gian gặp gỡ, trao đổi và chia sẻ cho nhau biết những trải nghiệm mới nhất của mình.</p>\n\n\n\n<span id=\"more-688\"></span>\n\n\n\n<p>Chúng tôi hi vọng bạn có thể sắp xếp thời gian tham dự một buổi Meetup do những người phụ trách cộng đồng WordPress tổ chức trong tháng 09/2018 này.</p>\n\n\n\n<ul><li>Thời gian: 14:00 đến 17:00 ngày 22/09/2018</li><li>Địa điểm: Văn phòng SOLIS LAB, Tầng 3 toà nhà Anh Minh, số 36 Hoàng Cầu, Đống Đa, Hà Nội<br /></li><li>Các chủ đề sẽ nhắc đến: Gutenberg, Taxonomies &amp; Custom Post Types, ứng dụng WordPress trông mô hình website bất động sản,&#8230;</li></ul>\n\n\n\n<p>Do quy mô sự kiện nhỏ với số lượng người tối đa là 30, chúng tôi hi vọng biết bạn là ai bằng việc đề nghị những ai tham gia đăng ký trong form nhập sau đây:</p>\n\n\n\n<div class=\"wp-block-button aligncenter\"><a class=\"wp-block-button__link\" href=\"https://docs.google.com/forms/d/e/1FAIpQLSeFMSi1lcLZBHVRXOI8rTf0228V6AeMR7CtxzgIPJjKTw0sug/viewform?usp=sf_link\">Đăng ký tham dự Meetup</a></div>\n\n\n\n<p><em>*Chúng tôi sẽ gửi các thông báo về thời gian, địa điểm nếu có thay đổi qua email. Các bạn sẽ nhận được email xác nhận tham gia sự kiện.</em></p>\n\n\n\n<p>Ngoài ra, bạn có thể theo dõi thông tin về sự kiện qua:</p>\n\n\n\n<figure class=\"wp-block-embed-meetup-com wp-block-embed is-type-rich is-provider-meetup\">\n<style type=\"text/css\">#meetup_oembed .mu_clearfix:after { visibility: hidden; display: block; font-size: 0; content: \" \"; clear: both; height: 0; }* html #meetup_oembed .mu_clearfix, *:first-child+html #meetup_oembed .mu_clearfix { zoom: 1; }#meetup_oembed { background:#eee;border:1px solid #ccc;padding:10px;-moz-border-radius:3px;-webkit-border-radius:3px;border-radius:3px;margin:0; font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif; font-size: 12px; }#meetup_oembed h3 { font-weight:normal; margin:0 0 10px; padding:0; line-height:26px; font-family:Georgia,Palatino,serif; font-size:24px }#meetup_oembed p { margin: 0 0 10px; padding:0; line-height:16px; }#meetup_oembed img { border:none; margin:0; padding:0; }#meetup_oembed a, #meetup_oembed a:visited, #meetup_oembed a:link { color: #1B76B3; text-decoration: none; cursor: hand; cursor: pointer; }#meetup_oembed a:hover { color: #1B76B3; text-decoration: underline; }#meetup_oembed a.mu_button { font-size:14px; -moz-border-radius:3px;-webkit-border-radius:3px;border-radius:3px;border:2px solid #A7241D;color:white!important;text-decoration:none;background-color: #CA3E47; background-image: -moz-linear-gradient(top, #ca3e47, #a8252e); background-image: -webkit-gradient(linear, left bottom, left top, color-stop(0, #a8252e), color-stop(1, #ca3e47));disvplay:inline-block;padding:5px 10px; }#meetup_oembed a.mu_button:hover { color: #fff!important; text-decoration: none; }#meetup_oembed .photo { width:50px; height:50px; overflow:hidden;background:#ccc;float:left;margin:0 5px 0 0;text-align:center;padding:1px; }#meetup_oembed .photo img { height:50px }#meetup_oembed .number { font-size:18px; }#meetup_oembed .thing { text-transform: uppercase; color: #555; }</style><div id=\"meetup_oembed\" style=\"height:302px\">     <div style=\"max-height:262px;overflow:hidden\">          <h3>WordPress Meetup Hà Nội tháng 09/2018</h3>          <p style=\"margin:5px 0;font-size:16px\">Saturday, Sep 22, 2018,  2:00 PM</p>          <p style=\"margin: 0 0 5px;\"><span style=\"font-size:14px\"> SOLIS LAB Office</span><br /><span style=\"font-size:12px;\">Tầng 3 tòa nhà Anh Minh, Số 36 Hoàng Cầu &#8211; Đống Đa Hà Nội, al</span></p>          <span style=\"color:#4F8A10;font-size:16px;\">3 WordPressers Attending</span>  